import React, { useState } from 'react';
import { Dialog } from '@headlessui/react';

// Define the avatar interface
interface Avatar {
  id: number;
  url: string;
  alt: string;
}

// Generate diverse avatars using the lorelei style with various features
const generateAvatars = (): Avatar[] => {
  const avatars: Avatar[] = [];

  // Define variations for diversity
  const skinColors = ['f2d3b1', 'ecad80', '9e5622', '763900'];
  const hairColors = ['000000', '6a4e35', 'c68642', 'e6be8a', '85c2c6', '592454'];
  const hairStyles = ['shortCombover', 'longStraight', 'longCurly', 'shortCurly', 'bunUndercut', 'bun'];
  const expressions = ['smile', 'grin', 'neutral'];

  let id = 1;

  // Generate combinations of features
  for (const skin of skinColors) {
    for (const hair of hairColors) {
      for (const style of hairStyles) {
        for (const expression of expressions) {
          if (id <= 50) { // Keep the limit at 50 avatars
            const seed = Math.random().toString(36).substring(7);
            const url = `https://api.dicebear.com/7.x/adventurer/svg?seed=${seed}&skinColor=${skin}&hairColor=${hair}&hair=${style}&mouth=${expression}`;
            avatars.push({
              id,
              url,
              alt: `Avatar with ${skin} skin, ${hair} ${style} hair, ${expression} expression`
            });
            id++;
          }
        }
      }
    }
  }

  // Shuffle the array to randomize the order
  return avatars.sort(() => Math.random() - 0.5);
};

const avatars = generateAvatars();

interface AvatarSelectionProps {
  selectedUrl: string;
  onSelect: (url: string) => void;
}

const AvatarSelection: React.FC<AvatarSelectionProps> = ({ selectedUrl, onSelect }) => {
  const [isOpen, setIsOpen] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');
  const [hoveredAvatar, setHoveredAvatar] = useState<string | null>(null);
  const [failedImages, setFailedImages] = useState<Set<number>>(new Set());

  const filteredAvatars = searchTerm
    ? avatars.filter(avatar => 
        avatar.alt.toLowerCase().includes(searchTerm.toLowerCase()) && 
        !failedImages.has(avatar.id)
      )
    : avatars.filter(avatar => !failedImages.has(avatar.id));

  const handleImageError = (avatarId: number) => {
    setFailedImages(prev => new Set(Array.from(prev).concat([avatarId])));
  };

  return (
    <>
      <button
        onClick={() => setIsOpen(true)}
        className="w-32 h-32 rounded-full border-2 border-gray-300 hover:border-primary-500 transition-colors duration-200 overflow-hidden flex items-center justify-center bg-white"
      >
        {selectedUrl ? (
          <img
            src={selectedUrl}
            alt="Selected avatar"
            className="w-full h-full object-contain p-2"
            onError={(e) => {
              e.currentTarget.src = 'https://api.dicebear.com/7.x/bottts/svg?seed=fallback&backgroundColor=b6e3f4';
            }}
          />
        ) : (
          <div className="text-gray-400">
            Choose Avatar
          </div>
        )}
      </button>

      <Dialog
        open={isOpen}
        onClose={() => setIsOpen(false)}
        className="relative z-50"
      >
        <div className="fixed inset-0 bg-black/30" aria-hidden="true" />

        <div className="fixed inset-0 flex items-center justify-center p-4">
          <Dialog.Panel className="mx-auto max-w-4xl w-full bg-white dark:bg-gray-800 rounded-xl shadow-lg p-6">
            <Dialog.Title className="text-lg font-medium text-gray-900 dark:text-white mb-4">
              Select Your Avatar
            </Dialog.Title>

            <div className="mb-4">
              <input
                type="text"
                placeholder="Search avatars by style..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="w-full px-4 py-2 rounded-lg border border-gray-300 dark:border-gray-600 dark:bg-gray-700 dark:text-white focus:outline-none focus:ring-2 focus:ring-primary-500"
              />
            </div>

            <div className="grid grid-cols-4 sm:grid-cols-6 md:grid-cols-8 lg:grid-cols-10 gap-4 max-h-[60vh] overflow-y-auto p-2">
              {filteredAvatars.map((avatar) => (
                <button
                  key={avatar.id}
                  onClick={() => {
                    onSelect(avatar.url);
                    setIsOpen(false);
                  }}
                  onMouseEnter={() => setHoveredAvatar(avatar.id.toString())}
                  onMouseLeave={() => setHoveredAvatar(null)}
                  className={`relative aspect-square rounded-lg transition-all duration-200 overflow-hidden bg-white dark:bg-gray-700 hover:bg-gray-50 dark:hover:bg-gray-600 ${
                    selectedUrl === avatar.url
                      ? 'ring-2 ring-primary-500 bg-primary-50 dark:bg-primary-900'
                      : ''
                  }`}
                >
                  <img
                    src={avatar.url}
                    alt={avatar.alt}
                    className="w-full h-full object-contain p-2"
                    onError={() => handleImageError(avatar.id)}
                  />
                  {hoveredAvatar === avatar.id.toString() && (
                    <div className="absolute inset-0 flex items-center justify-center bg-black/40">
                      <span className="text-white text-sm font-medium">Select</span>
                    </div>
                  )}
                </button>
              ))}
            </div>

            <div className="mt-6 flex justify-between items-center">
              <div className="text-sm text-gray-500 dark:text-gray-400">
                {filteredAvatars.length} avatars available
              </div>
              <button
                onClick={() => setIsOpen(false)}
                className="px-4 py-2 text-sm font-medium text-gray-700 bg-white border border-gray-300 rounded-md hover:bg-gray-50 dark:bg-gray-700 dark:text-gray-300 dark:border-gray-600 dark:hover:bg-gray-600"
              >
                Cancel
              </button>
            </div>
          </Dialog.Panel>
        </div>
      </Dialog>
    </>
  );
};

export default AvatarSelection;
